const code=document.querySelectorAll("[data-language]");var str="";function highlight(text){var attr=/(\s[a-zA-Z:]+(?==))|(disabled)/g,tag=/(&lt;[w]+)|(&lt;[\/\w]+)|&gt;/g,value=/(\".+\")|(\'.+\')/g,spec=/([a-zA-Z]+(?=:))|(\w{2,3}\?)/g,mod=/(?<=\[)[^\]]+(?=])/g,comment=/([\/]{2}.*\n)|(&lt;!--.*\;)/g,t=text;return t=(t=(t=(t=(t=(t=t.replace(tag,m=>"$tg"+m+"$fn")).replace(attr,m=>"$an"+m+"$fn")).replace(value,m=>"$vl"+m+"$fn")).replace(mod,m=>"$md"+m+"$fn")).replace(spec,m=>"$sx"+m+"$fn")).replace(comment,m=>"$cm"+m+"$fn")}function conform(text){var fn=/\$fn/g,an=/\$an/g,vn=/\$vl/g,v2=/\$md/g,tn=/\$tg/g,sp=/\$sx/g,cn=/\$cm/g,t=text;return t=(t=(t=(t=(t=(t=(t=t.replaceAll(tn,'<span class="tag">')).replaceAll(an,'<span class="attr">')).replaceAll(vn,'<span class="value">')).replaceAll(sp,'<span class="spec">')).replaceAll(v2,'<span class="value-mod">')).replaceAll(cn,'<span class="comment">')).replaceAll(fn,"</span>")}code.forEach((function(elt){str=highlight(str=elt.innerHTML),elt.innerHTML=conform(str)}));